re, c\'est survivre,\nMais j\'ai pas le courage de mettre fin à mes jours,\nJe suis pas lâche, je suis comme tout le monde, j\'aime la vie,\nMais la vie sans amour, c\'est une nuit sans étoile.\n\nJe comprends les autres, mais mon cœur j\'y comprends rien,\nIl se fout de ma gueule, il se jette comme un pantin,\nContre les murs du doute, contre ses parois inébranlables,\nJe le supplie, mais il n\'écoute que mes pleurs.\n\nJe voudrais changer, être un mec qui comprend rien,\nUn homme capable, d\'aimer sur le seul attrait d\'un sourire,\nJe voudrais y croire, me lancer sans réfléchir,\nMais ma prison à moi, c\'est ma conscience.','','http://www.w3.org/2001/XMLSchema#string',4),(1271,1004242475785929948,'http://www.jamendo.com/get/track/id/album/audio/xspf/4801/?item_o=track_no_asc&aue=ogg2&n=all','','',2),(1272,6292664367112453173,'http://dbtune.org/jamendo/tag/synthetiseur','','',2),(1273,-3955824711414490249,'synthetiseur','','http://www.w3.org/2001/XMLSchema#string',4),(1274,-6178293064057905431,'http://www.jamendo.com/get/track/id/track/audio/play/46000','','',2),(1275,8283861980349620000,'http://www.jamendo.com/get/album/id/album/p2p/redirect/345/?p2pnet=ed2k&are=mp32','','',2),(1276,4826865513191427408,'http://www.jamendo.com/get/track/id/track/audio/xspf/16458','','',2),(1277,-3931254444458464689,'http://dbtune.org/jamendo/tag/bonheur','','',2),(1278,-5502931012539935646,'bonheur','','http://www.w3.org/2001/XMLSchema#string',4),(1279,-4719271345386782228,'http://dbtune.org/jamendo/record/5028','','',2),(1280,8167150999140120404,'http://sws.geonames.org/2017370/','','',2),(1281,-3773203976962540915,'http://statuslab.msk.ru','','',2),(1282,4311845013167666340,'http://img.jamendo.com/artists/s/statuslab.jpg','','',2),(1283,-8561258933102107158,'statuslab','','http://www.w3.org/2001/XMLSchema#string',4),(1284,3918416453980421489,'http://dbtune.org/jamendo/track/13215','','',2),(1285,-7798992661496443031,'http://www.jamendo.com/get/track/id/track/audio/xspf/13215',''