po de abrigo.\n\nEn medio del desorden de mis sentimientos\nY las promesas rotas y con el miedo\nDe volver atrás.\n\nNo necesito a nadie más, busco tu olor en los demás,\nMe quedo vacía por dentro, te encuentro de nuevo en mis sueños.\nNo necesito a nadie más, me da pereza despertar\nY hasta tirito al pensar que no estás… será que te echo e menos.\n\nTengo miedo a pensar que ya no sientas lo mismo,\nCuando vuelvas, amor,\nNo te arrepentirás, no te dejaré escapar.\n\nNo necesito a nadie más, me da pereza despertar\nY volver atrás… ohh\n\nNo necesito a nadie más, busco tu olor en los demás,\nMe quedo vacía por dentro, te encuentro de nuevo en mis sueños.\nNo necesito a nadie más, me da pereza despertar\nY hasta tirito al pensar que no estás… será que te echo e menos.','','http://www.w3.org/2001/XMLSchema#string',4),(1605,-2311794769062045604,'http://dbtune.org/jamendo/track/46000','','',2),(1606,-786765047649416031,'http://www.jamendo.com/get/track/id/track/audio/xspf/46000','','',2),(1607,-1794799257603915176,'arrival','','http://www.w3.org/2001/XMLSchema#string',4),(1608,2271604040979844988,'http://www.jamendo.com/get/track/id/track/audio/xspf/3478','','',2),(1609,4954112484287796159,'http://www.jamendo.com/get/track/id/track/audio/play/39131','','',2),(1610,-107366033233398271,'political','','http://www.w3.org/2001/XMLSchema#string',4),(1611,4684730273588920846,'http://dbtune.org/jamendo/tag/manipulation','','',2),(1612,4207846059399659534,'manipulation','','http://www.w3.org/2001/XMLSchema#string',4),(1613,-4132705257313486857,'http://www.jamendo.com/get/track/id/track/audio/play/3475','','',2),(1614,5231660592455803208,'http://www.jamendo.com/get/track/id/track/audio/xspf/3475','','',2),(1615,-8106549675283801745,'Les gens','','http://www.w3.org/2001/XMLSchema#string',4),(1616,9200087602316624144,'hypnotizeme','','http://www.w3.org/2001/XMLSchema#string',4),(1617,-832131976389376585,'http://www.jamendo.com/get/track/id/track/audio/play/39132','','',2),(1618,-1847